     constructor(props)
     {
         super(props);
         this.state={
             email:"",
             password:"",
             phone:""

         }
         this.handleChange = this.handleChange.bind(this);

         this.handleSubmit = this.handleSubmit.bind(this);
     }

      handleChange(evt) {
       const value = evt.target.value;
       this.setState({
         ...this.state,
         [evt.target.name]: value
       });
       console.log(this.state.email);
